import React, { useEffect, useState } from 'react';
import ProductList from './ProductList'; // Import the child component
import { fetchProducts } from './api'; // Assuming you have a fetchProducts function

function ParentComponent() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Fetch the products and update the state
    fetchProducts()
      .then((data) => {
        setProducts(data);
      })
      .catch((error) => {
        console.error('Error fetching products:', error);
      });
  }, []);

  return (
    <div>
      <h1>Product List</h1>
      <ProductList products={products} /> {/* Pass the products as a prop */}
    </div>
  );
}

export default ParentComponent;
